function App() {
  return (
      <div>
        <BrowserRouter>
        <nav class="navbar background">
            <p class="text">
              UniFind
            </p>
            <div class="logoimg">            
                <img scr="logo"/>
              </div>
            <ul class="nav-list">
              <li><a href="home">Home</a></li>
              <li><Link to="/home">Home</Link></li>
              <li><Link to="/universities">Universities</Link></li>
